  border-radius: 12px;
  text-align: center;

  &.active {
    position: relative;
    background: var(--success-grad-light);

    &::after {
      content: "";
      position: absolute;
      top: 8px;
      right: 8px;

      width: 19px;
      height: 19px;

      background: var(--success-grad-light);
      border-radius: 50%;
    }

    &:before {
      content: '';
      position: absolute;
      top: 8px;
      right: 8px;
      z-index: 2;

      box-sizing: border-box;
      width: 19px;
      height: 19px;
      border-radius: 50%;

      background: no-repeat center url('../../../assets/images/checkbox.svg');
    }
  }

  &:hover {
    cursor: pointer;
    background: var(--success-grad-light);
    box-shadow: 0px 30px 70px rgba(46, 45, 79, 0.15);
  }

  &__title {
    margin-bottom: 6px;
  }

  &__wrapper {
    border-radius: 12px;
    background-color: var(--text-color);
  }

  &__text-wrapper {
    width: 100%;
    word-wrap: break-word;
  }

  &__container {
    width: 130px;
    padding: 22px 15px 28px;

    border-radius: 12px;
    background-color: rgba(var(--text-color-code), 0.15);
