    switch(this.status) {
      case 'decline': 
        this.title = 'Decline';
        this.color = DECLINE_COLOR;
        break;
      case 'accept': 
        this.title = 'Accept';
        this.color = ACCEPT_COLOR;
        break;
      case 'non-selected': 
        this.title = 'Non-selected';
        this.color = NON_SELECTED_COLOR;
        break;
      default: 
        this.title = 'Non-selected';
        this.color = NON_SELECTED_COLOR;
    }
  }

  ngOnInit(): void {
    this.setProps();
  }

  ngOnChanges(): void {
    this.setProps();
  }
}

